import React from 'react'
import GoogleMapReact from 'google-map-react'

export default function Map() {
 const  defaultProps = {
    center: {
      lat: 59.95,
      lng: 30.33,
    },
    zoom: 11,
  }
return (
      <div className='map' >
        <GoogleMapReact
          bootstrapURLKeys={{ key: 'AIzaSyBbASV8bFWX0YMAGV1MpzxKuwJZ7nF63Zo'}}
          defaultCenter={defaultProps.center}
          defaultZoom={defaultProps.zoom}
        >
        </GoogleMapReact>
      </div>
    );
}
